/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";

function Nav() {
  return (
    <nav>
      <ul>
        <li>
          <a href="#" style={{ backgroundColor: "red" }}>
            Home
          </a>
        </li>
        <li>
          <a href="#">Contact Me</a>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
